export default function Wall() {
    const [messages, setMessages] = useState(null)

    useEffect(() => {
        fetch('http://localhost:8000/api/wall/', {
            method: 'GET'
        })
        .then(data => data.json())
        .then(data => {setMessages(data.data);
                        console.log(messages)})
        .catch(error => console.error(error))
    }, [])

    return (
        <div>
            <ul>
            {messages.map((item) => (
                <li></li>
            ))}
            </ul>
        </div>
    )
}
